import React from "react"
import {
  BrowserRouter as Router,
  Routes,
  Route,
  NavLink,
} from "react-router-dom"
import { MDBBreadcrumb, MDBBreadcrumbItem } from "mdb-react-ui-kit"

export default function App() {
  return (
    <MDBBreadcrumb>
      <NavLink className="nav-link" to="/" activeclassname="active">
        <MDBBreadcrumbItem active>Home</MDBBreadcrumbItem>
      </NavLink>
      <NavLink className="nav-link" to="/games" activeclassname="active">
        <MDBBreadcrumbItem active>Game</MDBBreadcrumbItem>
      </NavLink>
      {/* <Routes>
        <Route
          path="/"
          element={<MDBBreadcrumbItem active>Home</MDBBreadcrumbItem>}
        ></Route>
        <Route
          path="/games"
          element={<MDBBreadcrumbItem active>Game</MDBBreadcrumbItem>}
        ></Route>
      </Routes> */}
    </MDBBreadcrumb>
  )
}
